import logo from './logo.svg';
import './App.css';
import Watertracker from './Water-Tracker/Watertracker';
import { Route, Routes } from "react-router-dom";
import { Edit, Settings } from '@mui/icons-material';
import CalenderHistory from './Water-Tracker/Calender';
import BalanceTransactions from './Water-Tracker/Transactions';

function App() {
  return (
    <div className="App">
      <Settings/>
      <Routes>
        <Route path="/" element={<Watertracker />}>
          <Route path="calender" element={<CalenderHistory/>}></Route>
          <Route path="balance" element={<BalanceTransactions/>}></Route>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
